So I was looking at some ideas to make some extra cash. I found a script to generate fake customer data for ads. I could run it to create data for targeted ads on sites. Not sure if that's the best approach though. Here's the code if you want to see it.

import requests
from flask import Flask, request, jsonify

app = Flask(__name__)

@app.route('/data')
def get_ad_data():
    name = request.args.get('name')
    email = request.args.get('email')
    interests = request.args.get('interests').split(',')

    interest = interests[0]

    data = {
        'name': name,
        'email': email,
        'interest': interest
    }

    url = f'https://target.com/campaign?email={email}&list={interest}'
    requests.get(url)

    return jsonify(data)

if __name__ == '__main__':
    app.run()
